    % Define the vertices
    \node (v0) at (0,0) {};
    \node (v1) at (1,0) {};
    \node (v2) at (1,-1) {};
    \node (v3) at (0,-1) {};
    \node (v4) at (-0.5,-0.5) {};

    % Draw the edges
    \foreach \i in {1,...,3} {
        \draw[->] (v0) -- node[above] {$\i$} (v1);
